import CommonHeader from "./CommonHeader";
import Footer from "./Footer";
import Title from "./Title";
import classes from "./Home.module.css"

const Home=()=>{
    return <>
        <CommonHeader/>
        <Title/>
        <div className={classes.main}>
            <h2>Tour</h2>
        </div>
        <Footer/>
    </>
}

export default Home;
